import React from 'react';
import img1 from '../images/DIY/01.jpg';

const one = {
    width : '50%',
    height : '500px'
}

const DIYClass1 = () => {
    return(
        <>
        <div>
            <h2>안녕</h2>
        <img src={img1} alt="사진" style={one} />
        </div>
        </>
    );
};

export default DIYClass1;
